import {
    connect
} from "react-redux";
import {
    useState
} from 'react';

const BASE_URL = "https://5e9935925eabe7001681c856.mockapi.io/api/v1/catalog/";

export const getCatalog = () => {
    const cu = fetch(BASE_URL)
        .then(res => res.json())
        .then(data => data);

    console.log("cu" + cu)
    return cu;
}
